(1514732753,'https://aeon.co/videos/odourless-world-what-smell-means-to-those-who-dont-have-it',14530961,22463627,200,'text/html',68944,'utf-8','2017-06-28 08:29:04','0000-00-00 00:00:00','Odourless world: what smell means to those who don‚Äôt have it','While many might consider smell to be one of our less vital senses, it is nonetheless an integral part of most people‚Äôs conscious experience, entwining with our memories, giving us warnings of nearby dangers and subtly shaping our subjective world at any given moment.',104,1,0,1,1,0,1,0,NULL,'en',NULL,1498656544,NULL,NULL,NULL,NULL,NULL),
(1653422551,'http://ej.ru/?a=note&id=30858',51453,51453,200,'text/html',29612,'utf-8','2017-07-04 09:31:12','2017-07-04 09:30:00','The federal government is blowing up mannequins to teach you about fireworks safety','There are a lot of interesting jobs within the federal government, from president to member of Congress to Supreme Court justice.  Yet one little-known job is, to me, the most fascinating: the person who gets to blow up a bunch of mannequins with fireworks.',227,1,0,1,1,0,1,0,NULL,'en',NULL,1499178672,NULL,NULL,NULL,NULL,NULL),
(1748259901,'https://medium.com/art-of-practicality/22-books-that-expand-your-mind-and-change-the-way-you-live-47da380eaf3d',7521431,7521431,200,'text/html',138547,'utf-8','2017-07-21 11:30:27','2017-05-18 00:00:00','22 Books That Expand Your Mind and Change The Way You Live','For the past few years, I‚Äôve formed a habit of asking everyone for book recommendations. It‚Äôs one of the habits that has truly changed my life.  Reading is my favorite way to develop my mind because it‚Äôs the most effective way to learn something. But not every book changes the way you think.',1407,0,0,1,1,0,1,0,NULL,'en',NULL,1495928342,NULL,NULL,NULL,NULL,NULL),
(1808422207,'https://www.vox.com/policy-and-politics/2017/7/4/15916910/july-4th-fireworks-safety',151453,151453,200,'text/html',29612,'utf-8','2017-07-04 09:31:12','2017-07-04 09:30:00','The federal government is blowing up mannequins to teach you about fireworks safety','There are a lot of interesting jobs within the federal government, from president to member of Congress to Supreme Court justice.  Yet one little-known job is, to me, the most fascinating: the person who gets to blow up a bunch of mannequins with fireworks.',227,1,0,1,1,0,1,0,NULL,'en',NULL,1499178672,NULL,NULL,NULL,NULL,NULL),
(1838968092,'https://medium.com/art-of-practicality/22-books-that-expand-your-mind-and-change-the-way-you-live-47da380eaf3d',7521431,7521431,200,'text/html',138547,'utf-8','2017-07-21 11:30:27','2017-05-18 00:00:00','22 Books That Expand Your Mind and Change The Way You Live','For the past few years, I‚Äôve formed a habit of asking everyone for book recommendations. It‚Äôs one of the habits that has truly changed my life.  Reading is my favorite way to develop my mind because it‚Äôs the most effective way to learn something. But not every book changes the way you think.',1407,0,0,1,1,0,1,0,NULL,'en',NULL,1495928342,NULL,NULL,NULL,NULL,NULL),
(2104094547,'https://cdn.dribbble.com/users/679488/screenshots/4313053/data-sent.jpg',36111144,36111144,0,'image/jpeg',62761,'','2018-03-07 17:55:52','0000-00-00 00:00:00','','',0,1,0,2,0,0,0,0,NULL,'',NULL,1520466952,NULL,NULL,NULL,NULL,NULL),
(2136231202, 'https://www.wired.com/story/tricky-business-of-measuring-consciousness/', 835, 835, 200, 'text/html', 154040, 'utf-8', '2018-04-09 12:55:34', '2018-04-02 06:00:00', 'The Tricky Business of Measuring Consciousness', 'The only thing you know for sure is that you are conscious. All else is inference, however reasonable. There is something in your head that generates experiences: the words you are reading on this page, the snore of a bulldog on a red carpet, the perfume of roses on a desk.', 1446, 0, 0, 1, 0, 0, 1, 0, null, 'en', null, 1523249217, null, null, null, null, null),
(2137233325, 'https://www.cnn.com/2018/04/03/health/reading-aloud-to-kids-go-ask-your-dad/index.html', 832, 832, 200, 'text/html', 37904, 'utf-8', '2018-04-08 23:19:12', '2018-04-03 00:00:00', 'Reading is fundamental -- to the family''s happiness', 'Go Ask Your Dad is parenting advice with a philosophical bent as one dad explores what we want out of life, for ourselves and our children, through useful paradigms and best practices. Share your insight at the CNN Parenting Facebook page.', 1229, 0, 0, 1, 0, 0, 1, 0, null, 'en', null, 1522744576, null, null, null, null, null),
(2138431914, 'https://www.nature.com/articles/d41586-018-03922-x', 10136, 10136, 200, 'text/html', 15949, 'utf-8', '2018-04-09 11:00:13', '2018-04-04 00:00:00', 'Tom Lehrer at 90: a life of scientific satire', 'In 1959, the mathematician and satirist Tom Lehrer ‚Äî who turns 90 this month ‚Äî performed what he characteristically called a ‚Äúcompletely pointless‚Äù scientific song at Harvard University in Cambridge, Massachusetts. (He was a PhD student there at the time.', 1016, 1, 0, 1, 1, 0, 1, 0, null, 'en', null, 1522966673, null, null, null, null, null),
(2142120324, 'https://www.nytimes.com/interactive/2018/04/07/upshot/millions-of-eviction-records-a-sweeping-new-look-at-housing-in-america.html', 745, 745, 200, 'text/html', 24928, 'utf-8', '2018-04-09 13:04:43', '2018-04-07 00:00:00', 'In 83 Million Eviction Records, a Sweeping and Intimate New Look at Housing in America', 'RICHMOND, Va. ‚Äî Before the first hearings on the morning docket, the line starts to clog the lobby of the John Marshall Courthouse. No cellphones are allowed inside, but many of the people who‚Äôve been summoned don‚Äôt learn that until they arrive.', 1865, 0, 0, 1, 0, 0, 1, 0, null, 'en', null, 1523295957, null, null, null, null, null),
(2142165945, 'https://www.theguardian.com/lifeandstyle/2018/apr/07/barbara-ehrenreich-natural-causes-book-old-enough-to-die', 12224275, 12224275, 200, 'text/html', 112383, 'utf-8', '2018-04-09 10:28:07', '2018-04-07 05:01:00', 'When do you know you''re old enough to die? Barbara Ehrenreich has some answers', 'Four years ago, Barbara Ehrenreich, 76, reached the realisation that she was old enough to die.', 1449, 0, 0, 1, 0, 0, 1, 0, null, 'en', null, 1523278314, null, null, null, null, null),
(2313275150, 'http://www.espn.com/college-football/story/_/id/24576392', 212224, 212224, 200, 'text/html', 36936, 'utf-8', '2018-09-12 06:49:48', '2018-09-05 00:00:00', 'A football family and a sportswriter, bound by grief', 'IRVINE, Calif. -- I came of age in the wake of Woodward and Bernstein, when young journalists were taught to be as neutral as the painted highway stripe. After nearly four decades as a sportswriter, I have learned to negotiate a middle ground between my training and my life experience.', 2511, 0, 0, 1, 0, 0, 1, 0, NULL, 'en', NULL, 1536153951, NULL, NULL, NULL, NULL, NULL),
(2314421326, 'https://spectrum.ieee.org/tech-talk/telecom/security/everything-you-need-to-know-about-wpa3', 4081, 4081, 200, 'text/html', 47474, 'utf-8', '2018-09-26 14:24:08', '0000-00-00 00:00:00', 'Wi-Fi Gets More Secure: Everything You Need to Know About WPA3', 'The biggest Wi-Fi security update in 14 years was recently unveiled by the Wi-Fi Alliance. The Wi-Fi Protected Access 3 (WPA3) security certificate protocol provides some much-needed updates to the WPA2 protocol introduced in 2004.', 1341, 0, 0, 1, 0, 0, 1, 0, NULL, 'en', NULL, 1536317945, NULL, NULL, NULL, NULL, NULL),
